INSERT INTO `v1_fa8c419a56962a14564866aaaa1c873a66cc74674b95b81fc819fe2e184c824e` VALUES (0.5, 0, 0, "ふふ、相変わらず敏い子ね。\nそういうところ、家系なのかしら。\nああ、そういえば偏屈ジジイ……\nこほん、ユニークなお爺様たちは元気？", 1, 1007404, 0, 1007404043, 117531, 11, 5);
