INSERT INTO `v1_fa8c419a56962a14564866aaaa1c873a66cc74674b95b81fc819fe2e184c824e` VALUES (0.5, 0, 0, "さてな。\n存知のように、ぼくも今は都暮らしだ。\n里の連中とはしばらく会っとらんが、\nまあ、向こう百年はくたばらんだろう。", 1, 1007404, 0, 1007404050, 111011, 11, 5);
