INSERT INTO `v1_fa8c419a56962a14564866aaaa1c873a66cc74674b95b81fc819fe2e184c824e` VALUES (0.5, 0, 0, "そうね、逞しい人たちだものね……\nはあ、懐かしい。あの人たちには昔、\nよく研究のことで因縁をつけられたわ。", 1, 1007404, 0, 1007404055, 117531, 11, 5);
